import React,{useState} from 'react';


function Posts({text,likes}) {
    const [like,setLike] = useState()
    const liked=(likes)=>{
        setLike(like)
    }

  return <div>
    <h3>{text}</h3>
    <button onClick={()=>liked(likes)}>{likes}</button>  
  </div>;
}

export default Posts;
